var _1GEtVcFEoJS = createElements(_IsSiarqBjSB,[[`class`,``]],`SPAN`,`نهاية الأسبوع.. يومين مرت وكأنها أيام وليال كثيرة، بتجاربها ودروسها ومشاعرها.,.,كانت تجربة مميزة ولا تنسى، وصلنا للدوار صباح يوم السبت وكانت لحظات انبهار ومشاعر لم أستطع تحديدها، واش هي فرح أو امتنان أو حزن أو،أو.. طريقة استقبال سكان المنطقة لينا وابتساماتهم وتعاملهم.. ثم استمرت تلك المشاعر طوال الفترة لي قضيتها معهم إلى اليوم..,كرمهم وطيبتهم وحلاوة لسانهم.. وحزنت أنني لم أكن أفهم الأمازيغية التي تحدثني بها نساء المنطقة، ولكن قدرت أنني نفهم ماذا يريدون إيصاله.. أنا، كلمات بالدارجة وهوما، بالأمازيغية لكن كان هناك تواصل بيننا.. رغم ذلك.,.,نقدر نقول كانت تجربة تركت أثرا عظيما وماكانتش فقط عابرة.,أحيي كل الشباب المنخرطين في أي عمل تطوعي، وأحترم المجهودات التي يقومون بها لإدخال البهجة لقلوب الآخرين.. جزاكم الله خيرا جميعا، وأيضا كل من له رغبة أنه ينخارط في أعمال تطوعية، أكيد لن أحتاج أنني نقولكم لا تتردوا، ولو يكونوا أفعال بسيطة لي ممكن تساعد ولو بالقليل لا تتردوا.,.,وتقديري واحترامي هنا أوجهه لـ,لي قدرات أنها تكون مشرفة على القافلة وتنظمها في وقت وجيز جدا بتعدد أهدافها (حفر بئر، إصلاح المسجد والمسيد والروض، وتقديم ملابس) ونجحت في ذلك.. وشكرا أيضا,بكل أعضاءها..,وجميع الشباب المشاركين لي تقاسمنا وإياهم هاد التجربة..,وكان لي شرف مشاركتها مع,و,و,📷,وشكرا,على الصورة 🙏🏻`);
